import React from 'react';
import './Home.css'; // Importa o CSS

const Home = () => {
    return (
        <div>
            <h1>Bem-vindo à Página Home</h1>
            <p>Esta é a área de conteúdo principal da sua aplicação.</p>
        </div>
    );
};

export default Home;
